import React from 'react';

class Main extends React.Component{
    render() {
        return (
            <div>
            {this.props.loggedIn ? "" : 
            <a href="http://localhost:8888">
              <button>
                Log into Spotify
              </button>
            </a>
            }
            {this.props.loggedIn ? 

            <div>
              <form>
                <input 
                  type="text" 
                  placeholder="Enter artists name" 
                  value={this.props.artists} 
                  onChange={this.props.handleSearchChange}
                />
                <button type="button" onClick={() => this.props.handleSearchArtistId}>
                  Search top tracks
                </button>
              </form>

              <div>
                {this.props.tracks.map(track => (
                  <li key={track.id}>{track.name}</li>
                ))}
                { this.props.tracks.length > 0 ? 
                <div>
                  <input
                    type="text"
                    placeholder="Playlist Name"
                    value={this.props.playlistName}
                    onChange={this.props.handlePlaylistName}
                  /> 
                  <button onClick={() => this.props.handleCreatePlaylist}>
                  Create playlist
                  </button>
                </div>
              : ""}
              </div>
            </div> : ""}
        </div>
        )
    }
}

export default Main
